func testRoomToManyAddOpRoomRoomMembers(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Room
	var b, c, d, e RoomMember

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, roomDBTypes, false, strmangle.SetComplement(roomPrimaryKeyColumns, roomColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*RoomMember{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, roomMemberDBTypes, false, strmangle.SetComplement(roomMemberPrimaryKeyColumns, roomMemberColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*RoomMember{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddRoomRoomMembers(ctx, tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if a.ID != first.RoomID {
			t.Error("foreign key was wrong value", a.ID, first.RoomID)
		}
		if a.ID != second.RoomID {
			t.Error("foreign key was wrong value", a.ID, second.RoomID)
		}

		if first.R.Room != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.Room != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.RoomRoomMembers[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.RoomRoomMembers[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.RoomRoomMembers().Count(ctx, tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}
